// actions/numberActions.js
import { SET_NUMBER, RESET_NUMBER, DECREMENT_NUMBER } from './types';

export const setNumber = (newNumber) => ({
  type: SET_NUMBER,
  payload: newNumber,
});

export const resetNumber = () => ({
  type: RESET_NUMBER,
});

export const decrementNumber = (newNumber) => ({
  type: DECREMENT_NUMBER,
  payload: newNumber,
});
